import "./App.css";

function App() {
  return (
    <>
      <header>헤더입니다.</header>
      <main>
        제목 : <input placeholder="제목을 입력해주세요" />
        내용 : <input placeholder="내용을 입력해주세요" />
        <button>추가</button>
      </main>
    </>
  );
}

export default App;
